function ExpenseDate(props) {
  const monat = props.date.toLocaleString("de-DE", { month: "long" });
  const jahr = props.date.getFullYear();
  const tag = props.date.toLocaleString("de-DE", { day: "2-digit" });
  return (
    <div>
      <div>{monat}</div>
      <div>{jahr}</div>
      <div>{tag}</div>
    </div>
  );
}

export default ExpenseDate;
